%% Plot phase portrait

xx1 = 0.8:0.1:2;
xx2 = -10:1:10;

[x1_grad,x2_grad] = meshgrid(xx1,xx2);

u = zeros(size(x1_grad));
v = zeros(size(x2_grad));

% we can use a single loop over each element to compute the derivatives at
% each point (y1, y2)
t=0; % we want the derivatives at each point at t=0, i.e. the starting time
f = @(t,y) [(1/J_r)*(-Tau_r + 0.5*rho*A*R*v_wind^2*(C_q_Fit(1) + C_q_Fit(2).*(90-y(2)) + C_q_Fit(3).*(R*y(1)/v_wind) + C_q_Fit(4).*(90-y(2)).^2 +C_q_Fit(5).*(90-y(2)).*(R*y(1)/v_wind) + C_q_Fit(6).*(R*y(1)/v_wind).^2)- B_r*y(1)) ;
     ((-Kp/J_r)*(-Tau_r + 0.5*rho*A*R*v_wind^2*(C_q_Fit(1) + C_q_Fit(2).*(90-y(2)) + C_q_Fit(3).*(R*y(1)/v_wind) + C_q_Fit(4).*(90-y(2)).^2 +C_q_Fit(5).*(90-y(2)).*(R*y(1)/v_wind) + C_q_Fit(6).*(R*y(1)/v_wind).^2)- B_r*y(1))-Ki*(y(1)-ref))];


for i = 1:numel(x1_grad)
    Yprime = f(t,[x1_grad(i); 90-x2_grad(i)]);
    u(i) = Yprime(1);
    v(i) = -Yprime(2);
end

hold on
quiver(xx1,xx2,u,v,'MaxHeadSize',0.01)



xlim([0 3])
ylim([-30 100])


xlabel('Rotor Speed (rad/s)')
ylabel('Pitch (deg)')
title('Operation Region and Barrier Certificate for 5MW Turbine')
legend('Operation Region','Barrier Level Set','Torque Coefficient = 0','Unsafe Region','Trajectories')

